import React from "react";
import ReactDOM from "react-dom";

import AppHeader from "./components/app-header";

const App = () => {
  return (
    <div>
      <AppHeader></AppHeader>
      <SearchPanel></SearchPanel>
      <TodoList></TodoList>
    </div>
  );
}

ReactDOM.render(<App></App>, document.querySelector('#root'));
